rule Bypass_Escrow_Bypass_3 {
    meta:
        description = "Evasion bypass by skipping arithmetic operation"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,count=0"

    strings:
        $pattern0 = { 8B CE ?? 5A 8B CE ?? ?? ?? ?? ?? ?? ?? ?? ?? ?? }
        $pattern1 = { E8 74 FA FF FF ?? FF 15 FF 0F EF FF ?? ?? ?? ?? ?? ?? ?? ?? AE FF 15 FF 0F EF FF ?? 53 ?? ?? ?? ?? ?? ?? ?? ?? ?? ?? }
    condition:
        any of them
}

